import React from 'react';
import { useAuth } from '../context/AuthContext';

const Dashboard = () => {
    const { user } = useAuth();
  
    console.log(user); // Check if user is logged
  
    return (
      <div>
        <h1>Dashboard</h1>
        {user ? <p>Welcome, {user.coor_fname} {user.coor_lname}!</p> : <p>No user data found!</p>}
      </div>
    );
  };
  

export default Dashboard;
